import React from "react";
import "../styles/Footer.css";

function Footer() {
  return (
    <footer className="footer">
      <p> ©️2025 Made by Syeda Zainab</p>
      <p>Visit me on:</p>
      <div className="socials">
        <a href="https://github.com/syedazainabshariq">GitHub</a>
        <a href="#">LinkedIn</a>
        <a href="#">Portfolio</a>
      </div>
    </footer>
  );
}  

export default Footer;
